create table attendance (attendance_id serial, date date, json varchar(1000), period_id int8, subject_id int8, teach_id int8, primary key (attendance_id));
create table class_period (period_id serial, from_time time, to_time time, primary key (period_id));
create table class_section (section_id serial, class_id int8, section_name varchar(255), primary key (section_id));
create table section_student (section_id int8 not null, stud_id int8 not null, primary key (section_id, stud_id));
create table semester (sem_id int8 generated by default as identity, semester_name varchar(255), end_date date, start_date date, primary key (sem_id));
create table section_subject (subject_id serial, section_id int8, sem_id int8, subject_name varchar(255), primary key (subject_id));
create table stud_class (class_id serial, class_name varchar(255), class_year int4, end_date date, start_date date, primary key (class_id));
create table student (id serial, dob date, first_name varchar(255), gender varchar(255), last_name varchar(255), middle_name varchar(255), mobile_number int8, profile oid, role_number varchar(255), primary key (id));
create table teacher (id serial, dob date, first_name varchar(255), gender varchar(255), last_name varchar(255), middle_name varchar(255), mobile_number int8, teacher_number varchar(255), primary key (id));
create table teacher_subject (sub_id int8 not null, teach_id int8 not null, primary key (sub_id, teach_id));
create table users (user_id serial, account_type varchar(255), activated boolean, id int8, password varchar(255), username varchar(255), primary key (user_id));
alter table if exists class_section add constraint FKi65yeqy1o7n4icu1k47mm7y98 foreign key (class_id) references stud_class;
